  useEffect(() => {
    // Fetch all blog posts
    axios
      .get("http://localhost:9999/posts")
      .then((response) => {
        setBlog(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
    }, []);
  return (
    <>
      <Header />
      <Row>
        <Col className="col-9">

        </Col>
        <Col className="col-3"></Col>
      </Row>
      <Footer />
    </>
  );
};

export default Detailblog;
